<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>RheumWave — Interactive Rheumatology Ultrasound Cases</title>
  <style>
    :root {
      --gradient-start: #0f2e4f;
      --gradient-end: #1b7b87;
      --bg: #f8fafc;
      --card-bg: #ffffff;
      --text: #0f172a;
      --muted: #64748b;
      --accent: #1b7b87;
      --border: #e2e8f0;
      --ring: rgba(27,123,135,0.25);
      --shadow: 0 6px 20px rgba(0,0,0,0.08);
    }
    [data-theme="dark"] {
      --bg: #0f172a;
      --card-bg: #1e293b;
      --text: #f1f5f9;
      --muted: #94a3b8;
      --border: #334155;
      --accent: #22d3ee;
      --ring: rgba(34,211,238,0.3);
      --shadow: 0 8px 24px rgba(0,0,0,0.4);
    }
    body { margin:0; font-family: 'Inter', system-ui, -apple-system, Segoe UI, Roboto, sans-serif; background: var(--bg); color: var(--text); transition: background .3s ease, color .3s ease; }

    header { background: linear-gradient(90deg, var(--gradient-start), var(--gradient-end)); color:#fff; padding:14px 24px; display:flex; align-items:center; justify-content:space-between; position:sticky; top:0; z-index:100; box-shadow: var(--shadow); }
    .brand { display:flex; flex-direction:column; line-height:1.2 }
    .brand h1 { font-size:1.5rem; font-weight:800; margin:0 }
    .brand span { font-size:.9rem; color:#cfe9ef }
    nav { display:flex; align-items:center; gap:18px }
    nav a { color:#fff; text-decoration:none; font-weight:600; transition:opacity .2s ease }
    nav a:hover { opacity:.8 }
    .theme-btn{ background:#fff; color:var(--accent); border:none; padding:8px 14px; border-radius:8px; font-weight:600; cursor:pointer; transition:all .2s ease }
    .theme-btn:hover{ background:#e2e8f0 }

    .container { max-width:1200px; margin:0 auto; padding:24px }
    .controls { display:grid; grid-template-columns: repeat(auto-fit, minmax(180px, 1fr)); gap:12px; background:var(--card-bg); padding:16px; border-radius:12px; box-shadow:var(--shadow); margin-bottom:20px }
    .controls input, .controls select { padding:10px; border-radius:8px; border:1px solid var(--border); font-size:.95rem; width:100%; background:var(--card-bg); color:var(--text) }

    .grid{ display:grid; grid-template-columns: repeat(auto-fit, minmax(280px, 1fr)); gap:16px }
    .card{ background:var(--card-bg); border-radius:12px; padding:16px; box-shadow:var(--shadow); border:1px solid var(--border); display:flex; flex-direction:column; justify-content:space-between; transition: transform .15s ease, box-shadow .15s ease }
    .card:hover{ transform:translateY(-2px); box-shadow:0 8px 24px rgba(0,0,0,.1) }
    .card h3{ margin:0; font-size:1.1rem; color:var(--accent) }
    .card p{ color:var(--muted); font-size:.9rem }

    .meta{ font-size:.85rem; color:var(--muted); margin-top:6px }
    .progress{ width:100%; height:6px; background:var(--border); border-radius:4px; margin-top:8px; overflow:hidden }
    .progress span{ display:block; height:100%; background:var(--accent); transition:width .3s ease }

    .actions{ margin-top:10px; display:flex; flex-wrap:wrap; gap:8px }
    .btn{ background:var(--accent); color:#fff; border:none; padding:8px 12px; border-radius:6px; font-size:.9rem; cursor:pointer }
    .btn.secondary{ background:#e2e8f0; color:var(--text) }

    footer{ text-align:center; padding:24px; color:var(--muted); font-size:.85rem; margin-top:40px }
  </style>
</head>
<body>
  <header>
    <div class="brand">
      <h1>RheumWave</h1>
      <span>Interactive Rheumatology Ultrasound Cases</span>
    </div>
    <nav>
      <a href="about.html">About</a>
      <a href="contact.html">Contact</a>
      <button class="theme-btn" id="themeToggle">Switch Theme</button>
    </nav>
  </header>

  <div class="container">
    <div class="controls">
      <input id="search" type="search" placeholder="Search cases...">
      <select id="region">
        <option value="">All Regions</option>
        <option>Hand/Wrist</option>
        <option>Knee</option>
        <option>Foot/Ankle</option>
        <option>Shoulder</option>
        <option>Elbow</option>
      </select>
      <select id="pathology">
        <option value="">All Pathologies</option>
        <option>Inflammatory Arthritis</option>
        <option>Crystal Arthropathy</option>
        <option>Osteoarthritis</option>
        <option>Nerve Entrapment</option>
        <option>Regional Pain Syndrome</option>
      </select>
      <select id="level">
        <option value="">All Levels</option>
        <option>Intro</option>
        <option>Core</option>
        <option>Advanced</option>
      </select>
    </div>

        <button class='btn secondary' onclick='testSubmission()'>Test Submission</button>
    <div id="caseGrid" class="grid"></div>
  </div>

  <footer>© <span id="year"></span> RheumWave — All rights reserved.</footer>

  <script>
    // ---------- Config ----------
    document.getElementById('year').textContent = new Date().getFullYear();
    const THEME_KEY = 'rheumwave-theme';
    const ID_KEY = 'rheumwave-id';
    const CONSENT_KEY = 'rheumwave-consent';
    const PROGRESS_KEY = 'rheumwave-progress';
    const SHEET_URL = 'https://script.google.com/macros/s/AKfycbwPmUlahh0zvg2LFMAUSa--CA_PgfBR-JZQKGmuDdA5_F67aUa0xP4a6MsZKAhfuNZPbQ/exec';

    // ---------- Theme toggle ----------
    const savedTheme = localStorage.getItem(THEME_KEY);
    if (savedTheme === 'dark') document.documentElement.dataset.theme = 'dark';
    document.getElementById('themeToggle').addEventListener('click', () => {
      const isDark = document.documentElement.dataset.theme === 'dark';
      document.documentElement.dataset.theme = isDark ? 'light' : 'dark';
      localStorage.setItem(THEME_KEY, isDark ? 'light' : 'dark');
    });

    // ---------- Participant ID + Consent ----------
    let userId = localStorage.getItem(ID_KEY);
    let consent = localStorage.getItem(CONSENT_KEY);
    if (!userId) {
      userId = prompt('Enter your Participant ID (assigned by the study coordinator):');
      if (userId) localStorage.setItem(ID_KEY, userId);
    }
    if (consent !== 'yes') {
      const agreed = confirm('By using RheumWave, I consent to collection of my anonymized learning data (ID, timing, accuracy, confidence, and progress) for research purposes.');
      if (agreed) {
        localStorage.setItem(CONSENT_KEY, 'yes');
      } else {
        alert('You can continue without submitting data to the study. Progress will remain local.');
      }
    }

    // ---------- Dataset ----------
    const cases = [
      {id:1, title:'RA MCP Synovitis', desc:'Inflammatory arthritis with erosive changes and PD activity.', region:'Hand/Wrist', pathology:'Inflammatory Arthritis', level:'Core'},
      {id:2, title:'Gout MTP Joint', desc:'Crystal arthropathy with double contour and hyperechoic tophi.', region:'Foot/Ankle', pathology:'Crystal Arthropathy', level:'Core'},
      {id:3, title:'Knee Osteoarthritis', desc:'Osteophytes and joint space narrowing visualized on US.', region:'Knee', pathology:'Osteoarthritis', level:'Intro'},
      {id:4, title:'Carpal Tunnel Syndrome', desc:'Nerve entrapment with median nerve cross-sectional enlargement.', region:'Hand/Wrist', pathology:'Nerve Entrapment', level:'Advanced'},
      {id:5, title:'Lateral Epicondylitis', desc:'Regional pain syndrome with tendinopathy and hypervascularity.', region:'Elbow', pathology:'Regional Pain Syndrome', level:'Core'}
    ];

    // ---------- State ----------
    const progress = JSON.parse(localStorage.getItem(PROGRESS_KEY) || '{}');
    const timers = {}; // { caseId: startTime }

    // ---------- Rendering & Filters ----------
    const grid = document.getElementById('caseGrid');
    function renderCases(){
      const q = document.getElementById('search').value.toLowerCase();
      const r = document.getElementById('region').value;
      const p = document.getElementById('pathology').value;
      const l = document.getElementById('level').value;
      grid.innerHTML='';
      const filtered = cases.filter(c =>
        (!q || c.title.toLowerCase().includes(q) || c.desc.toLowerCase().includes(q)) &&
        (!r || c.region === r) && (!p || c.pathology === p) && (!l || c.level === l)
      );

      filtered.forEach(c => {
        const pct = progress[c.id] || 0;
        const card = document.createElement('div');
        card.className = 'card';
        card.innerHTML = `
          <div>
            <h3>${c.title}</h3>
            <p>${c.desc}</p>
            <div class="meta"><strong>Region:</strong> ${c.region} | <strong>Pathology:</strong> ${c.pathology} | <strong>Level:</strong> ${c.level}</div>
            <div class='progress'><span style='width:${pct}%'></span></div>
          </div>
          <div class='actions'>
            <button class='btn' onclick='startCase(${c.id})'>Start</button>
            <button class='btn' onclick='completeCase(${c.id})'>Submit</button>
            <button class='btn secondary' onclick='exportProgress()'>Export</button>
            <button class='btn secondary' onclick='importProgress()'>Import</button>
            <button class='btn secondary' onclick='resetCase(${c.id})'>Reset</button>
          </div>`;
        grid.appendChild(card);
      });
    }

    ['search','region','pathology','level'].forEach(id => document.getElementById(id).addEventListener('input', renderCases));

    // ---------- Progress & Timing ----------
    function saveProgress(){ localStorage.setItem(PROGRESS_KEY, JSON.stringify(progress)); }
    window.startCase = function(id){ timers[id] = Date.now(); alert('Timer started for this case.'); }

    window.completeCase = function(id){
      // progress
      progress[id] = 100; saveProgress();
      const c = cases.find(x => x.id === id);

      // metrics
      const startedAt = timers[id] || Date.now();
      const timeSpent = Math.max(0, Math.round((Date.now() - startedAt)/1000)); // seconds
      const accuracyStr = prompt('Accuracy (0–100)?', '100');
      const accuracy = Math.max(0, Math.min(100, Number(accuracyStr||0)))/100; // as proportion
      const confidenceStr = prompt('Confidence (1–5)?', '4');
      const confidence = Math.max(1, Math.min(5, Number(confidenceStr||4)));

      // submit if consented and ID present
      const idVal = localStorage.getItem(ID_KEY);
      const consentVal = localStorage.getItem(CONSENT_KEY) === 'yes';
      if (idVal && consentVal) {
        const payload = {
          participantId: idVal,
          caseId: c.title,
          progress: progress[id] || 0,
          accuracy,
          confidence,
          timeSpent,
          level: c.level,
          region: c.region,
          pathology: c.pathology
        };
        // Fire-and-forget post to Google Apps Script (no-cors avoids console CORS noise)
        fetch(SHEET_URL, {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          mode: 'no-cors',
          body: JSON.stringify(payload)
        });
        alert('Submitted to study. Thank you!');
      } else {
        alert('Saved locally. (No submission: missing consent or participant ID)');
      }
      
    // ---------- Test submission ----------
    async function testSubmission(){
      const demo = {
        participantId: 'TEST-123',
        caseId: 'Ping',
        progress: 0,
        accuracy: 1,
        confidence: 5,
        timeSpent: 3,
        level: 'Intro',
        region: 'Hand/Wrist',
        pathology: 'Inflammatory Arthritis'
      };
      try {
        const res = await (() => { const fd = new FormData(); fd.append('payload', JSON.stringify(demo)); return fetch(SHEET_URL, { method: 'POST', body: fd }); })();
        const json = await res.json().catch(()=>({ note:'no JSON response (check Web App permissions)' }));
        alert('Posted! Check your Sheet.\n' + JSON.stringify(json));
      } catch (e) {
        alert('Post failed: ' + e.message);
      }
    }

    renderCases();
    }

    
    // ---------- Reset progress ----------
    window.resetCase = function(id){
      if(confirm('Reset progress for this case?')){
        progress[id] = 0;
        saveProgress();

    // ---------- Export / Import ----------
    window.exportProgress = function(){
      const data = JSON.stringify(progress);
      const blob = new Blob([data], {type:'application/json'});
      const a = document.createElement('a');
      a.href = URL.createObjectURL(blob);
      a.download = 'rheumwave_progress.json';
      a.click();
    }

    window.importProgress = function(){
      const input = document.createElement('input');
      input.type = 'file'; input.accept = 'application/json';
      input.onchange = async () => {
        const file = input.files?.[0]; if(!file) return;
        try {
          const text = await file.text();
          const data = JSON.parse(text);
          Object.assign(progress, data);
          saveProgress();

        caseId: 'Ping',
        progress: 0,

        confidence: 5,

        level: 'Intro',
        region: 'Hand/Wrist',
        pathology: 'Inflammatory Arthritis'
      };
      try {
        const res = await (() => { const fd = new FormData(); fd.append('payload', JSON.stringify(demo)); return fetch(SHEET_URL, { method: 'POST', body: fd }); })();
        const json = await res.json().catch(()=>({ note:'no JSON response (check Web App permissions)' }));
        alert('Posted! Check your Sheet.\n' + JSON.stringify(json));
      } catch (e) {
        alert('Post failed: ' + e.message);
      }
    }

        caseId: 'Ping',
        progress: 0,
        accuracy: 1,

      };

        const res = await (() => { const fd = new FormData(); fd.append('payload', JSON.stringify(demo)); return fetch(SHEET_URL, { method: 'POST', body: fd }); })();

    renderCases();
  </script>
